Les Queutardes: The Receptionist (Alpha France) XXX FRENCH Classic (DVDRip)

To pay her studies and participate in the costs of collective life that she leads with 3 friends, Catherine, 20 years old, works at the reception of an old hotel led by 2 unbearable associates. One night , on the brink of nervous breakdown, she flees crying and joins her friends. They decide as a revenge to transform the Honorable hotel by a House of fun and debauchery of all kinds.

